import React from "react";

export default function About() {
  return (
    <section id="about">
      <h1>Hi, I'm Sravanthi. I love to build amazing apps.</h1>
      <p>
        My current knowledge in full stack development such as JavaScript, web
        component frameworks and UI technologies helped me to gain easy
        understanding in application process and the related responsibilities. I
        have used Jenkins, Docker and the relevant tools used in continuous
        integration and deployment.
      </p>
      <div>
        <a href="#contact">Work With Me</a>
        <a href="#projects">See My Past Work</a>
      </div>
    </section>
  );
}
